import './App.css';
import { Account } from './components/Accout/Account';
import { Badges } from './components/Badges';
import { From } from './components/From';
import { Nav } from './components/Nav';
import { Login } from './components/Login/Login';
// import { Route, Routes } from 'react-router-dom';
import { Notifications } from './components/Accout/Notifications';
import { Connections } from './components/Accout/Connections';
import { Registration } from './components/Login/Registration';
import { Password } from './components/Login/Password';
import { Navbar2 } from './components/Navbar2';






function App() {
  return (
      <div>
        <Navbar2/> 
          <Nav/>
          <Badges/>
          <Login/>
          <Registration/>
          <Password/>
          <Account/>
          <Notifications/>
          {/* <Connections/> */}
          <Routes>
            <Route path="/account" element={<Account/>}/>
            <Route path="/notificarions" element={<Notifications/>}/>
            <Route path="/connections" element={<Connections/>}/>
          </Routes>

          <From/>



      </div>
  );
}

export default App;
